import React from 'react';
import { motion } from 'framer-motion';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>React Animation Example</h1>
      <motion.div
        className="circle"
        animate={{ x: [0, 300, 0], opacity: [1, 0, 1] }}
        transition={{ duration: 3, repeat: Infinity }}
      />
    </div>
  );
}

export default App;
